import React from 'react';
import logo from './logo.svg';
import './App.css';
import CoronaImage from './images/image.png'
import Tabular from './table/tabular';

function App() {
  return (
    <div className="container">
      <img style={{ width: '370px', marginTop: '50px', alignContent: 'center' }} src={CoronaImage} alt='Corona Image' />
      <Tabular />
    </div>
  );
}

export default App;
